import React, { useMemo, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Box,
  Typography,
  Button,
  Paper,
  Card,
  CardContent,
  Divider,
  CircularProgress,
  Alert,
} from '@mui/material';
import styled from 'styled-components';
import { useVan } from '../contexts/VanContext';

interface StepButtonProps {
  active?: boolean;
}

const StyledSidebar = styled(Paper)`
  width: 250px;
  padding: 16px;
  display: flex;
  flex-direction: column;
  gap: 8px;
  height: calc(100vh - 64px);
  position: fixed;
  left: 0;
  top: 64px;
`;

const StyledContent = styled(Box)`
  margin-left: 250px;
  padding: 24px;
`;

const StepButton = styled(Button)<StepButtonProps>`
  justify-content: flex-start;
  text-align: left;
  padding: 16px;
  background-color: ${props => (props.active ? '#e3f2fd' : 'transparent')};
  &:hover {
    background-color: #e3f2fd;
  }
`;

function ReviewData(): React.ReactElement {
  const navigate = useNavigate();
  const { vanData } = useVan();
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);

  const backupData = useMemo(() => {
    try {
      const saved = localStorage.getItem('companyData');
      return saved ? JSON.parse(saved) : null;
    } catch {
      return null;
    }
  }, []);

  const formattedData = useMemo(() => {
    const data = vanData.companyData || backupData || {};
    return {
      empresa: {
        nome: data.razaoSocial || '[NOME DA EMPRESA]',
        cnpj: data.cnpj || '[CNPJ DA EMPRESA]',
      },
      responsavel: {
        nome: data.responsavelNome || '[NOME DO RESPONSÁVEL]',
        email: data.responsavelEmail || '[E-MAIL DO RESPONSÁVEL]',
        telefone: data.responsavelTelefone || '[TELEFONE DO RESPONSÁVEL]',
      },
      conta: {
        banco: vanData.selectedBank?.name || data.banco || '[BANCO]',
        agencia: data.agencia || '[AGÊNCIA]',
        conta: data.conta || '[CONTA]',
        convenio: data.convenio || '[CONVÊNIO]',
      },
      gerente: {
        nome: data.gerenteConta || '[NOME GERENTE]',
        email: data.gerenteEmail || '[EMAIL GERENTE]',
        telefone: data.gerenteTelefone || '[TELEFONE GERENTE]',
      },
    };
  }, [vanData, backupData]);

  const handleSubmit = async () => {
    setLoading(true);
    setError(null);
    try {
      const data = vanData.companyData || backupData;
      if (!data) throw new Error('Dados ausentes');
      localStorage.setItem('companyData', JSON.stringify(data));
      navigate('/success');
    } catch (err) {
      setError('Erro ao processar os dados.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box>
      <Box
        sx={{
          height: '64px',
          backgroundColor: 'primary.main',
          display: 'flex',
          alignItems: 'center',
          padding: '0 24px',
          position: 'fixed',
          top: 0,
          left: 0,
          right: 0,
          zIndex: 1000,
        }}
      >
        <img src="/tecno_branca.png" alt="Tecnospeed" style={{ height: '30px' }} />
      </Box>

      <StyledSidebar elevation={1}>
        <StepButton variant="text" color="primary">Instituição bancária</StepButton>
        <StepButton variant="text" color="primary">Produtos</StepButton>
        <StepButton variant="text" color="primary">Preenchimento de dados</StepButton>
        <StepButton active variant="text" color="primary">Conferir e validar</StepButton>
      </StyledSidebar>

      <StyledContent>
        <Container maxWidth="md" sx={{ mt: 8 }}>
          <Typography variant="h5" gutterBottom>
            4. Conferir e validar informações da carta
          </Typography>
          <Typography variant="body1" color="text.secondary" gutterBottom>
            Confira todas as informações abaixo. Se estiverem corretas, clique em "Confirmar e Enviar Carta".
          </Typography>

          {error && <Alert severity="error" sx={{ my: 2 }}>{error}</Alert>}

          <Card sx={{ mt: 4 }}>
            <CardContent>
              <Typography variant="h5" gutterBottom align="center">Boletos</Typography>

              <Box sx={{ mt: 4 }}>
                <Typography paragraph>Ao BANCO {formattedData.conta.banco}</Typography>
                <Typography paragraph>A/C {formattedData.gerente.nome}</Typography>
                <Typography paragraph>Assunto: Intercâmbio de Arquivos – {formattedData.empresa.nome}</Typography>
                <Typography paragraph>
                  Comunicamos que nossa empresa passou a operar no relacionamento da EDI, transferência eletrônica de arquivos, através da VAN FINNET.
                </Typography>
                <Typography paragraph>
                  Solicitamos que esta Instituição disponibilize o suporte necessário para viabilizar esta implantação.
                </Typography>

                <Box sx={{ mt: 2 }}>
                  <Typography>Contratante:</Typography>
                  <Typography>Razão Social: {formattedData.empresa.nome}</Typography>
                  <Typography>CNPJ: {formattedData.empresa.cnpj}</Typography>
                  <Typography>Agência / Conta Corrente: {formattedData.conta.agencia} / {formattedData.conta.conta}</Typography>
                  <Typography>Convênio: {formattedData.conta.convenio}</Typography>
                </Box>

                <Box sx={{ mt: 3 }}>
                  <Typography>Van Contratada:</Typography>
                  <Typography>Razão Social: FINNET S/A Tecnologia</Typography>
                  <Typography>CNPJ: 03.607.206/0001-10</Typography>
                </Box>

                <Box sx={{ mt: 3 }}>
                  <Typography>Contato da Empresa:</Typography>
                  <Typography>Nome: {formattedData.responsavel.nome}</Typography>
                  <Typography>Email: {formattedData.responsavel.email}</Typography>
                  <Typography>Telefone: {formattedData.responsavel.telefone}</Typography>
                </Box>

                <Box sx={{ mt: 3 }}>
                  <Typography>Contato do gerente da conta:</Typography>
                  <Typography>Nome: {formattedData.gerente.nome}</Typography>
                  <Typography>Email: {formattedData.gerente.email}</Typography>
                  <Typography>Telefone: {formattedData.gerente.telefone}</Typography>
                </Box>

                <Box sx={{ mt: 3 }}>
                  <Typography paragraph>
                    Colocamo-nos à disposição para quaisquer esclarecimentos adicionais.
                  </Typography>
                  <Typography paragraph>Atenciosamente,</Typography>
                  <Box sx={{ mt: 4, textAlign: 'center' }}>
                    <Divider sx={{ width: '200px', margin: '0 auto' }} />
                    <Typography variant="body2" sx={{ mt: 1 }}>
                      Assinatura do Responsável pela empresa
                    </Typography>
                  </Box>
                </Box>
              </Box>
            </CardContent>
          </Card>

          <Box sx={{ display: 'flex', justifyContent: 'space-between', mt: 4 }}>
            <Button variant="outlined" onClick={() => navigate('/company-data')} disabled={loading}>
              Voltar
            </Button>
            <Button variant="contained" onClick={handleSubmit} disabled={loading}>
              {loading ? (
                <Box sx={{ display: 'flex', alignItems: 'center' }}>
                  <CircularProgress size={24} sx={{ mr: 1 }} color="inherit" />
                  Processando...
                </Box>
              ) : (
                'Confirmar e Enviar Carta'
              )}
            </Button>
          </Box>
        </Container>
      </StyledContent>
    </Box>
  );
}

export default ReviewData;
